import React, { useState } from 'react';

const ProductListPage = () => {
    const [searchTerm, setSearchTerm] = useState('');

    // Sample random car data
    const cars = [
        { id: 1, name: 'Tesla Model S', imageUrl: 'https://via.placeholder.com/400x250', description: 'Electric sedan with autopilot.' },
        { id: 2, name: 'Ford Mustang', imageUrl: 'https://via.placeholder.com/400x250', description: 'Classic muscle car with a powerful engine.' },
        { id: 3, name: 'Toyota Supra', imageUrl: 'https://via.placeholder.com/400x250', description: 'Sports car known for its speed.' },
        { id: 4, name: 'BMW X5', imageUrl: 'https://via.placeholder.com/400x250', description: 'Luxury SUV with high performance.' },
        { id: 5, name: 'Audi A8', imageUrl: 'https://via.placeholder.com/400x250', description: 'Premium sedan with advanced features.' },
        { id: 6, name: 'Mercedes-Benz G-Class', imageUrl: 'https://via.placeholder.com/400x250', description: 'Off-road vehicle with luxury touches.' }
    ];

    // Filter cars based on search term
    const filteredCars = cars.filter(car =>
        car.name.toLowerCase().includes(searchTerm.toLowerCase())
    );

    return (
        <div className="container mx-auto py-10 px-6">
            {/* Page Title */}
            <h1 className="text-4xl font-bold mb-8 text-gray-800 text-center">My Cars</h1>

            {/* Search Bar */}
            <div className="max-w-xl mx-auto mb-10">
                <input
                    type="text"
                    placeholder="Search cars..."
                    className="w-full p-4 border border-gray-300 rounded-lg shadow focus:outline-none focus:ring-2 focus:ring-blue-400 focus:border-transparent text-gray-700"
                    value={searchTerm}
                    onChange={(e) => setSearchTerm(e.target.value)}
                />
            </div>

            {/* Car List */}
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
                {filteredCars.map((car) => (
                    <div
                        key={car.id}
                        className="bg-white rounded-lg shadow-lg hover:shadow-2xl transform hover:scale-105 transition-all duration-300"
                    >
                        <img
                            src={car.imageUrl}
                            alt={car.name}
                            className="w-full h-56 object-cover rounded-t-lg"
                        />
                        <div className="p-6">
                            <h3 className="text-2xl font-semibold text-gray-800">{car.name}</h3>
                            <p className="text-gray-600 mt-2 mb-4">{car.description}</p>
                            <button className="w-full bg-blue-500 text-white py-2 rounded-md font-semibold hover:bg-blue-600 transition duration-200">
                                View Details
                            </button>
                        </div>
                    </div>
                ))}
            </div>

            {/* No Results Message */}
            {filteredCars.length === 0 && (
                <div className="text-center text-gray-500 mt-10 text-lg">
                    No cars found.
                </div>
            )}
        </div>
    );
};

export default ProductListPage;
